@world @wgpng feature!! after starting the initiative in 2012, a group in papua new guinea has added more “meri seif” — or women-safe buses — driven by trained female drivers to give women access to safe public transport. eight buses now operate in the capital of port moresby, where most women have experienced gender-based crime at least once in their lives 🇵🇬
