text:
pronouncement of gratitude from my artistic self to you. thank you for following me. 
i’ve reached a tipping point where elements in my life are cooperating on the love kadie’s creativity side - of my psyche, which allows me to share more of myself with you. i have tended towards abandoning my most creative urges - because - life. but my understanding of my core power has shifted a lot. 
my life has changed a lot in the past year and a half and it’s given me an opportunity to know myself better. and see that i’m better (i feel so much better) when i allow myself to express my creativity, which often comes out in weird and surprising ways. i’m embracing that. not gonna judge it anymore. 
i’m thankful for female friends who do their artist thing in ways that move me more into mine, who i’ve known for years, who have sat with me, shared their perspectives, their paths, their struggles, their talent, and included me in awesome projects of theirs. 
@monicapasqualmusic 
@littlespiralmusic

@essencemusic

@janefrankmusic 
@rebmfish 
i thank myself for allowing myself to indulge my stories, my songs, my whimsical and surrealist dreams. outloud. in front of you. this is some scary s—-. but it’s juicing me up and i feel more alive and present with myself than ever. 
#alittlepeace #milck #elementsandironies #kadiekellymusic #thankful #grateful #friendship #creativity #creativepower #eastbayartist #oakland #music #piano #poetry #originalwork #femaleartist #womenempowerment #iwontkeepquiet #metoo

